import React from 'react';
import Sidebar from '../../components/Sidebar';
import WelcomeHeader from '../../components/WelcomeHeader';
import WhiteRectangle from '../../components/WhiteRectangle';
import NotificationBell from '../../components/NotificationBell';
import '../../styles/shared.css';
import './order.css';

const Order = () => {
  return (
    <div className="dashboard-container">
      <Sidebar />
      <div className="dashboard-main">
        <NotificationBell />
        <div className="order-welcome-container">
          <WelcomeHeader />
        </div>
        <div className="order-rectangle-wrapper">
          <WhiteRectangle title="Total Revenue: 0.00">
            <div className="order-labels-row">
              <div className="order-label">Revenue</div>
              <div className="order-label">Date</div>
              <div className="order-label">Product Name</div>
              <div className="order-label">Customer</div>
              <div className="order-label">Total Amount</div>
              <div className="order-label">Status</div>
            </div>
            <div className="order-separator"></div>
            <div className="order-data-row">
              <div className="order-data-cell">$3.99</div>
              <div className="order-data-cell">24/5/2025 14:38</div>
              <div className="order-data-cell">Cocacola</div>
              <div className="order-data-cell">Tom Lee</div>
              <div className="order-data-cell">1</div>
              <div className="order-data-cell">Brought</div>
            </div>
          </WhiteRectangle>
        </div>
      </div>
    </div>
  );
};

export default Order;
